import { FaUserMd } from "react-icons/fa";

function GradientDoctorIcon() {
  return (
    <div className="text-5xl text-transparent bg-clip-text bg-gradient-to-r from-[#69BDF2] via-[#D480F2] to-[#FD7D7D]">
      <FaUserMd />
    </div>
  );
}

export default GradientDoctorIcon;
